import React, { Component } from "react";
import PropTypes from "prop-types";
import MultiSearch from "./presenter";

class Container extends Component {
  state = {
    loading: true,
    loading2: true,
    text : ""
  };
  static propTypes = {
    
    mmr: PropTypes.array.isRequired,
    summonername: PropTypes.string.isRequired,
    getMultiMMR: PropTypes.func.isRequired,

  };
  componentDidMount() {

  }
  onClick = (e) => {
    const {getMultiMMR } = this.props;
    const {text} = this.state;
    console.log(text);
    const value = text.replace(/님이 로비에 참가했습니다./g, ',').replace(/\n/g, '')
    console.log(value.split(','));
    var i = 0;
    var str = "";
    while(i<value.length -1){
      str = str + ","
    }
    console.log(str);
  }
  onKeyPress = (e) =>{
    this.setState({
      text : e.target.value
    })

  }
  componentWillReceiveProps = nextProps => {
    const {loading2} = this.state;
    if(nextProps.mmr && loading2){
      const {getmmrdate } = this.props;
      getmmrdate();
      this.setState({
        loading2: false
      });


    }
    if(nextProps.mmrdate){
      console.log("dd");
      this.setState({
        loading: false
      });

    }
  };
  render() {
    const { summonername } = this.props;
    
    return (
      <MultiSearch  {...this.state} {...this.props} onKeyPress={this.onKeyPress}  onClick={this.onClick} />
    );
  }
}

export default Container;
